// Helper function prototypes
const numpy_array_t* desktop_val_input_get_array_by_name(const char* name);
const numpy_array_t* desktop_val_input_get_array_by_index(int index);

// Helper function implementations
const numpy_array_t* desktop_val_input_get_array_by_name(const char* name) {
    for (int i = 0; i < DESKTOP_VAL_INPUT_ARRAY_COUNT; i++) {
        if (strcmp(desktop_val_input_arrays[i].name, name) == 0) {
            return &desktop_val_input_arrays[i];
        }
    }
    return NULL; // Array not found
}

const numpy_array_t* desktop_val_input_get_array_by_index(int index) {
    if (index >= 0 && index < DESKTOP_VAL_INPUT_ARRAY_COUNT) {
        return &desktop_val_input_arrays[index];
    }
    return NULL; // Index out of bounds
}

